可那个人却指着船说：“到了对岸再说吧，反正我在船上划了一条线，剑是从这儿落下去的，到时候从这里下去找就行啦！”

划船的人说：“你的剑掉进了水里，剑又不会跟着船走，怎么还能在对岸找到呢？”

那个人不听船夫的话，于是，船夫把船划到了对岸。

这时，那个人脱掉衣服，从他划的那条线那里跳了下去，可他捞了很久什么也没捞到。

剑掉进了河里，现在船走了这么远，他是不能从船上的线找到剑的。

